## Remarks  
 <span data-ttu-id="50a51-110">Jeśli `Count` jest już równa pojemności, pojemność listy jest podwojona przez automatyczne ponowne przydzielanie tablicy wewnętrznej i skopiowanie istniejących elementów do nowej tablicy przed dodaniem nowego elementu.</span><span class="sxs-lookup"><span data-stu-id="50a51-110">If `Count` already equals the capacity, the capacity of list is doubled by automatically reallocating the internal array and copying the existing elements to the new array before the new element is added.</span></span>  
  
 <span data-ttu-id="50a51-111">Jeśli `Count` jest mniejsza niż pojemność, ta metoda jest operacją 0 (1).</span><span class="sxs-lookup"><span data-stu-id="50a51-111">If `Count` is less than the capacity, this method is an 0(1) operation.</span></span> <span data-ttu-id="50a51-112">Jeśli pojemność musi zostać zwiększona w celu uwzględnienia nowego elementu, ta metoda jest operacją 0 (n), gdzie n to `Count`.</span><span class="sxs-lookup"><span data-stu-id="50a51-112">If the capacity needs to be increased to accommodate the new element, this method becomes an 0(n) operation, where n is `Count`.</span></span>  
  
 <span data-ttu-id="50a51-113"><xref:System.Xml.Schema.XmlSchemaExternal> <xref:System.Xml.Schema.XmlSchemaImport> <xref:System.Xml.Schema.XmlSchemaInclude>Metoda oczekuje tylko i jego typów pochodnych (,, i <xref:System.Xml.Schema.XmlSchemaRedefine>) jako parametrów. <xref:System.Xml.Schema.XmlSchemaObjectCollection.Add%2A></span><span class="sxs-lookup"><span data-stu-id="50a51-113">The <xref:System.Xml.Schema.XmlSchemaObjectCollection.Add%2A> method expects only <xref:System.Xml.Schema.XmlSchemaExternal> and its derived types (<xref:System.Xml.Schema.XmlSchemaImport>, <xref:System.Xml.Schema.XmlSchemaInclude>, and <xref:System.Xml.Schema.XmlSchemaRedefine>) as parameters.</span></span> <span data-ttu-id="50a51-114">Poniższy przykład ilustruje Dodawanie dołączonego schematu do <xref:System.Xml.Schema.XmlSchema.Includes%2A> kolekcji istniejącego <xref:System.Xml.Schema.XmlSchema> obiektu.</span><span class="sxs-lookup"><span data-stu-id="50a51-114">The following example illustrates adding an included schema to the <xref:System.Xml.Schema.XmlSchema.Includes%2A> collection of an existing <xref:System.Xml.Schema.XmlSchema> object.</span></span>  
  
```vb  
Dim schema As XmlSchema = New XmlSchema()  
  
Dim textReader As XmlTextReader = New XmlTextReader("include.xsd")  
Dim includeSchema As XmlSchema = XmlSchema.Read(textReader, null)  
  
Dim include As XmlSchemaInclude = New XmlSchemaInclude()  
include.Schema = includeSchema;  
schema.Includes.Add(include);  
```  
  
```csharp  
XmlSchema schema = new XmlSchema();  
  
XmlTextReader textReader = new XmlTextReader("include.xsd");  
XmlSchema includeSchema = XmlSchema.Read(textReader, null);  
  
XmlSchemaInclude include = new XmlSchemaInclude();  
include.Schema = includeSchema;  
schema.Includes.Add(include);  
```
